	<script type='text/javascript'>
		$(function(){
			$('.thumb').mouseenter(function(){
				var ratio = ($(this).find('img').attr('clientHeight')) / ($(this).find('img').attr('clientWidth'));
				//$(this).animate({width:400,height:ratio * 400},1000);
				//$(this).find('img').animate({width:400},1000);
				$(this).width(400);
				$(this).height(400*ratio);
				$(this).find('img').width(400);
				$(this).find('img').height(400*ratio);
			});
			$('.thumb').mouseleave(function(){
				var ratio = ($(this).find('img').attr('clientHeight')) / ($(this).find('img').attr('clientWidth'));
				$(this).width(100);
				$(this).height(100);
				if(ratio > 1){
					$(this).find('img').width(100);
					$(this).find('img').height(100*ratio);
				}
				else{
					$(this).find('img').height(100);
					$(this).find('img').width(100/ratio);
				}
			});
		});
	</script>

